import React from 'react'

export default function Tokenpairs(props) {
    console.log(props.token.pairs)
    var img1=""
    var img2=""
    for (let i = 0; i < props.token.pairs.length; i++) {
        for (let b = 0; b < props.tokens.length; b++) {
            console.log(props.token.pairs)
        }
        pairs.push(
            <div key={i}>
                <img src={img1}></img>
                <img src={img2}></img>
            </div>
        )
    }
    return (
        <div className={"section " + props.cn}>
            pairs
        </div>
    )
}
